import React, { Component } from 'react'
import Navbar from './Components/Navbar/Navbar'
import Home from './Components/Home/Home'
import About from './Components/About/About'


export class App extends Component {
  render() {
    return (
      <div>
        <Navbar></Navbar>
        <Home></Home>
        <About></About>
      </div>
    )
  }
}

export default App
